const reduxLogLevel = Level('redux', 200);

void initLogger() {
  Logger.root.level = Level.ALL;
  Logger.root.onRecord.listen((record) {
    final time =  DateFormat.Hms().format(DateTime.now());
    final msg = Colorize('[$time ${record.level} ${record.loggerName}] ${record.message}');
    switch (record.level) { // ignore: case_expression_type_implements_equals
      case Level.SHOUT: msg..white()..bgRed(); break;
      case Level.SEVERE: msg.lightRed(); break;
      case Level.WARNING: msg.yellow(); break;
      case Level.INFO: msg.white(); break;
      case Level.CONFIG:
      case Level.FINE:
      case Level.FINER:
      case Level.FINEST: msg.darkGray(); break;
      case reduxLogLevel: msg.blue(); break;
      default:
        msg.default_slyle();
    }
    if (!isProductionMode) {
      debugPrint(msg.toString(), wrapWidth: 150);
    }
  });
}
```
